import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as r,a as t}from"./app-4844bbf2.js";const h={},n=t('<h1 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h1><h1 id="铃仙·优昙华院·因幡" tabindex="-1"><a class="header-anchor" href="#铃仙·优昙华院·因幡" aria-hidden="true">#</a> 铃仙·优昙华院·因幡</h1><blockquote><p>兔子专使群：603849482</p></blockquote><h2 id="评价" tabindex="-1"><a class="header-anchor" href="#评价" aria-hidden="true">#</a> 评价</h2><h3 id="滴滴" tabindex="-1"><a class="header-anchor" href="#滴滴" aria-hidden="true">#</a> <strong>滴滴</strong></h3><p>不说别的，她克19</p><h3 id="fin" tabindex="-1"><a class="header-anchor" href="#fin" aria-hidden="true">#</a> <strong>FIN</strong></h3><p>能进能退，乃真正法器！兔子这个机体，乍一看没什么亮眼的，感觉很平庸的机体，但打起来会让自己怀疑人生，感觉做什么都是错的，望而生畏！<br> 娇小的身材，巨大的判定！适应多种情况的B、C，兔子的立回几乎没有死角！压制有2A连点和错防有利的6A，还有光速灵力1换1的2C和磨灵、磨血、粘度高的火箭。<br> 连段率很高，还有随便接的4卡和5卡。可惜速度慢容易被遛狗，没有好用的体术必杀让她和5失之交臂。</p><h3 id="涅槃" tabindex="-1"><a class="header-anchor" href="#涅槃" aria-hidden="true">#</a> <strong>涅槃</strong></h3><p>SC优秀（其实就是4卡5卡），怎么打都能带入。弹幕牵制能力优秀，粪霸对兔子的评分是最高的。</p><blockquote><p>原话：其他机体都可以机师能力强行五五开，只有兔子不犯错的话是无解的。</p></blockquote><p>不过其实我有点get不到点。优势很多:包括各类体术的大判定，弹幕暴风和磨血，全场打逆，蹲下来就看不见的矮子等等。<br> 但也有缺点让我没法给到T1:手毕竟还是有点短，弹幕说强但也没有到无解的程度，压制一定程度要看机师，我看不太到应对空压比其他一些机体明显强的地方，特别是感觉弱于某些强空压机体。</p><h3 id="cccc" tabindex="-1"><a class="header-anchor" href="#cccc" aria-hidden="true">#</a> <strong>CCCC</strong></h3><p>前两排（评分）我觉得一般是没啥疑问了 反正就是一个没什么短板或者能弥补的机体</p><h3 id="美琴" tabindex="-1"><a class="header-anchor" href="#美琴" aria-hidden="true">#</a> <strong>美琴</strong></h3><p>兔子这种跑的慢，自己又没有升龙的角色，我觉得到不了5的<br> 我觉得到5的必要条件就是你得有在被压制的时候的反制手段<br> 比如19的赖衣，升龙必杀技这种，所以我觉得16也到不了5<br> 16最多就4.5了，19就是牛逼在赖衣反击别人之后还能直接变成主动方</p>',16),d=[n];function o(c,i){return e(),r("div",null,d)}const p=a(h,[["render",o],["__file","intro.html.vue"]]);export{p as default};
